import React from "react";
import '../css/Skill.css'
import { v4 as uuidv4 } from 'uuid';

const Skills = () => {
    let initSkills=[
        {image:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/2048px-HTML5_logo_and_wordmark.svg.png",title:"Html"},
        {image:"",title:"Python"},
        {image:"",title:"sql"}]
    return(

        <div >
            <div className="Skill_box">
            {initSkills.map((Element) => (
                <a href="#" id={uuidv4()}  key={Element.title}><img className="image-icon" src={Element.image}/></a>

            ))}

            </div>

        </div>
    );
}
export default Skills;
